import React, { useEffect } from 'react'
import { Link } from 'react-router-dom'
import logo from '../../assets/logo.png'
import  Search from '../../assets/search.svg'
import './Navbar.css'
import Avatar from '../Avatar/Avatar'
import {useSelector ,useDispatch} from 'react-redux'
import { setCurrentUser } from '../../actions/currentUser'

const Navbar = () => {
    const dispatch = useDispatch()
    // var user=JSON.parse(localStorage.getItem('Profile'))
    // console.log(user)
    var user = useSelector((state) => (state.currentUserReducer));
  //  console.log(user)
    for(let i of user){
      console.log(i)
    }
      // console.log(user[Object.keys(user)]);
    useEffect(()=>{
      dispatch (setCurrentUser(JSON.parse(localStorage.getItem('Profile'))))},[dispatch])
         
  return (
    <nav className='Main-nav-div'>
       <div className='navbar'>
        <Link to='/' className='nav-item nav-logo'>
        <img src={logo} alt='logo' width='150'/>
        </Link>
        <Link to='/' className='nav-item nav-content'>About</Link>
        <Link to='/' className='nav-item nav-content'>Products</Link>
        <Link to='/' className='nav-item nav-content'>For Teams</Link>
        <form className='nav-form'>
            <img className='search-icon' src={Search} alt='' width='18'/>
            <input type='text' className='search-input' placeholder='Search...'></input>
        </form>        
            {
                user === null?
                <Link to='/Auth' className='nav-item nav-Link'>Log in </Link>:
                <>
                <Avatar backgroundColor='#009dff' px="9px" py="2px"  borderRadius="50%" color='white'> <Link to='/'  style={{color:"white",  textDecoration:"none"}}>A</Link></Avatar>
                <button className='nav-item nav-Link' style={{marginLeft:"6px"}}>Log out</button>
                </>
            }       
      </div>
    </nav>
    
  )
}

export default Navbar
